// ClassroomList.js
import ClassroomCard from './ClassroomCard';

const ClassroomList = ({ classrooms }) => {
  return (
    <div>
      {classrooms.map(classroom => (
        <ClassroomCard key={classroom.id} classroom={classroom} />
      ))}
    </div>
  );
};

export default ClassroomList;
